using System;
using System.Collections.Generic;
using System.Linq;

namespace AI_Calculator {

    public class Neuron {
        private List<double> weights = new List<double>();
        private double bias = 0.5; // random initial bias value

        public Neuron(List<double> weights) {
            this.weights = weights;
        }

        public double CalculateOutput(List<double> inputs) {
            if (inputs.Count!= weights.Count) {
                throw new Exception("Inputs and weights must have the same number of elements");
            }
            var sum = weights.Zip(inputs, (weight, input) => weight * input).Sum() + bias;
            return Sigmoid(sum);
        }

        private double Sigmoid(double x) {
            return 1 / (1 + Math.Exp(-x));
        }
    }

